func TestTxLevelSplit(t *testing.T) {
	// case 1: split empty levels
	// case 2: split 1 level into 1 chunk
	// case 3: split 1 level into 2 chunks, each have 1 tx
	// case 4: split 1 level into 3
	txLevels := TxLevel{}
	if len(txLevels.Split(1)) != 0 {
		t.Fatalf("invalid split, expected:0, got:%d", len(txLevels.Split(1)))
	}
	txLevels = TxLevel{newTxReq(1, 2, 10)}
	chunks := txLevels.Split(1)
	if len(chunks) != 1 {
		t.Fatalf("invalid split, expected:1, got:%d", len(chunks))
	}
	if len(chunks[0]) != 1 {
		t.Fatalf("invalid split, expected:1, got:%d", len(chunks[0]))
	}
	mock := &mockTx{req: chunks[0][0]}
	if mock.Value() != 10 {
		t.Fatalf("invalid split, expected:10, got:%d", mock.Value())
	}

	txLevels = TxLevel{newTxReq(1, 2, 10), newTxReq(2, 3, 20)}
	chunks = txLevels.Split(2)
	if len(chunks) != 2 {
		t.Fatalf("invalid split, expected:2, got:%d", len(chunks))
	}
	if len(chunks[0]) != 1 {
		t.Fatalf("invalid split, expected:1, got:%d", len(chunks[0]))
	}
	if len(chunks[1]) != 1 {
		t.Fatalf("invalid split, expected:1, got:%d", len(chunks[1]))
	}
	mock1, mock2 := &mockTx{req: chunks[0][0]}, &mockTx{req: chunks[1][0]}
	if mock1.Value() != 10 {
		t.Fatalf("invalid split, expected:10, got:%d", mock1.Value())
	}
	if mock2.Value() != 20 {
		t.Fatalf("invalid split, expected:20, got:%d", mock2.Value())
	}

	txLevels = TxLevel{newTxReq(1, 2, 10), newTxReq(2, 3, 20), newTxReq(3, 4, 30)}
	chunks = txLevels.Split(2)
	if len(chunks) != 2 {
		t.Fatalf("invalid split, expected:2, got:%d", len(chunks))
	}
	if len(chunks[0]) != 2 {
		t.Fatalf("invalid split, expected:2, got:%d", len(chunks[0]))
	}
	if len(chunks[1]) != 1 {
		t.Fatalf("invalid split, expected:1, got:%d", len(chunks[1]))
	}
	mock1, mock2, mock3 := &mockTx{req: chunks[0][0]}, &mockTx{req: chunks[0][1]}, &mockTx{req: chunks[1][0]}
	if mock1.Value() != 10 {
		t.Fatalf("invalid split, expected:10, got:%d", mock1.Value())
	}
	if mock2.Value() != 20 {
		t.Fatalf("invalid split, expected:20, got:%d", mock2.Value())
	}
	if mock3.Value() != 30 {
		t.Fatalf("invalid split, expected:30, got:%d", mock3.Value())
	}

	chunks = txLevels.Split(5)
	if len(chunks) != 3 {
		t.Fatalf("invalid split, expected:3, got:%d", len(chunks))
	}
	if len(chunks[0]) != 1 {
		t.Fatalf("invalid split, expected:1, got:%d", len(chunks[0]))
	}
	if len(chunks[1]) != 1 {
		t.Fatalf("invalid split, expected:1, got:%d", len(chunks[1]))
	}
	if len(chunks[2]) != 1 {
		t.Fatalf("invalid split, expected:1, got:%d", len(chunks[2]))
	}
	mock1, mock2, mock3 = &mockTx{req: chunks[0][0]}, &mockTx{req: chunks[1][0]}, &mockTx{req: chunks[2][0]}
	if mock1.Value() != 10 {
		t.Fatalf("invalid split, expected:10, got:%d", mock1.Value())
	}
	if mock2.Value() != 20 {
		t.Fatalf("invalid split, expected:20, got:%d", mock2.Value())
	}
	if mock3.Value() != 30 {
		t.Fatalf("invalid split, expected:30, got:%d", mock3.Value())
	}

}

func setTxIndex(allReq []*PEVMTxRequest) {
	for i, req := range allReq {
		req.txIndex = i
	}
}

func TestTxLevelRun(t *testing.T) {
	// case 1: empty txs
	case1 := func() {
		levels([]uint64{}, [][]int{}).Run(func(*PEVMTxRequest) *PEVMTxResult { return nil }, func(*PEVMTxResult) error { return nil }, nil, false, false)
	}
	// case 2: 4 txs with no dependencies, no conflicts
	case2 := func() {
		// mainDB: [1: 10, 2: 20, 3: 30, 4:40, 5:1, 6:1, 7:1, 8:1]
		// txs: [1,2,3,4] ->(all balances)-> [5,6,7,8]
		// true txdag: [][]int{nil, nil, nil, nil}
		// result:
		//	 mainDB: [1: 0, 2: 0, 3: 0, 4:0, 5:11, 6:21, 7:31, 8:41]
		//	 conflictNum: 0
		putMainDB(map[int]int{1: 10, 2: 20, 3: 30, 4: 40, 5: 1, 6: 1, 7: 1, 8: 1})
		allReqs := []*PEVMTxRequest{
			newTxReq(1, 5, 10),
			newTxReq(2, 6, 20),
			newTxReq(3, 7, 30),
			newTxReq(4, 8, 40),
		}
		setTxIndex(allReqs)
		txdag := int2txdag([][]int{
			nil, nil, nil, nil,
		})
		caller := caller{txs: make(map[*PEVMTxRequest]*mockTx)}
		err, _ := NewTxLevels(allReqs, txdag).Run(caller.execute, caller.confirm, nil, false, false)
		ok := checkMainDB(map[int]int{1: 0, 2: 0, 3: 0, 4: 0, 5: 11, 6: 21, 7: 31, 8: 41})
		if err != nil {
			t.Fatalf("failed, err:%v", err)
		}
		if !ok {
			t.Fatalf("invalid mainDB state")
		}
		if caller.conflictNum != 0 {
			t.Fatalf("conflict found, conflict:%d", caller.conflictNum)
		}
	}

	// case 3: 4 txs with 2 dependencies, no conflict
	//		actual:  t1->t0, t3->t2
	//		true txdag: [t0, t2], [t3, t4]
	//		result:  all of t1~t4 need rerun
	case3 := func() {
		// mainDB: [1: 10, 2: 20, 3: 0, 4:0, 5:1, 6:1]
		// txs: [1->3:10, 2->4:20, 3->5:10, 4->6:20]
		// true txdag: [][]int{nil, nil, {0}, {1}})
		// result:
		//	 mainDB: [1: 0, 2: 0, 3: 0, 4:0, 5:11, 6:21]
		//	 conflictNum: 0
		putMainDB(map[int]int{1: 10, 2: 20, 3: 0, 4: 0, 5: 1, 6: 1})
		allReqs := []*PEVMTxRequest{
			newTxReq(1, 3, 10),
			newTxReq(2, 4, 20),
			newTxReq(3, 5, 10),
			newTxReq(4, 6, 20),
		}
		setTxIndex(allReqs)
		txdag := int2txdag([][]int{
			nil, nil, {0}, {1},
		})
		caller := caller{txs: make(map[*PEVMTxRequest]*mockTx)}
		err, _ := NewTxLevels(allReqs, txdag).Run(caller.execute, caller.confirm, nil, false, false)
		ok := checkMainDB(map[int]int{1: 0, 2: 0, 3: 0, 4: 0, 5: 11, 6: 21})
		if err != nil {
			t.Fatalf("failed, err:%v", err)
		}
		if !ok {
			t.Fatalf("invalid mainDB state")
		}
		if caller.conflictNum != 0 {
			t.Fatalf("conflict found, conflict:%d", caller.conflictNum)
		}
	}

	// case 4: 4 txs with 2 dependencies, with 4 conflict
	//		actual:  t1->t0, t3->t2
	//		false txdag: [t4],[t3],[t0, t1]
	//		result:  all of t1~t4 need rerun
	case4 := func() {
		// mainDB: [1: 10, 2: 20, 3: 0, 4:0, 5:1, 6:1]
		// txs: [1->3:10, 2->4:20, 3->5:10, 4->6:20]
		// false txdag: {0}, nil, {-1}, {-1},
		// result:
		//	 mainDB: [1: 0, 2: 0, 3: 0, 4:0, 5:11, 6:21]
		//	 conflictNum: 2
		putMainDB(map[int]int{1: 10, 2: 20, 3: 0, 4: 0, 5: 1, 6: 1})
		allReqs := []*PEVMTxRequest{
			newTxReq(1, 3, 10),
			newTxReq(2, 4, 20),
			newTxReq(3, 5, 10),
			newTxReq(4, 6, 20),
		}
		setTxIndex(allReqs)
		txdag := int2txdag([][]int{
			{0}, nil, {-1}, {-1},
		})
		caller := caller{txs: make(map[*PEVMTxRequest]*mockTx)}
		err, _ := NewTxLevels(allReqs, txdag).Run(caller.execute, caller.confirm, nil, false, false)
		ok := checkMainDB(map[int]int{1: 0, 2: 0, 3: 0, 4: 0, 5: 11, 6: 21})
		if err != nil {
			t.Fatalf("failed, err:%v", err)
		}
		if !ok {
			t.Fatalf("invalid mainDB state")
		}
		if caller.conflictNum != 0 {
			t.Fatalf("conflict found, conflict:%d", caller.conflictNum)
		}
	}

	// smoking test
	case5 := func() {
		// addressSetA: 1~1000,	addressSetB: 1001~2000, addressSetC: 2001~3000
		// store balance 1~1000 for addressSetA into mainDB
		// A -> B -> C
		// check balance of C
		// txdag: all in level 0, some conflict will come up
		storeBalance := func(from, to int, value int) {
			for i := from; i <= to; i++ {
				if value == 0 {
					mockMainDB.Store(i, 0)
				} else {
					mockMainDB.Store(i, i)
				}
			}
		}
		storeBalance(1, 1000, 1)
		storeBalance(1001, 2000, 0)
		storeBalance(2001, 3000, 0)
		allReqs := make([]*PEVMTxRequest, 0, 2000)
		// addressSetA -> addressSetB
		for i := 1; i <= 1000; i++ {
			allReqs = append(allReqs, newTxReq(i, i+1000, i))
		}
		// addressSetB -> addressSetC
		for i := 1; i <= 1000; i++ {
			allReqs = append(allReqs, newTxReq(i+1000, i+2000, i))
		}
		setTxIndex(allReqs)
		// result of addressSetC
		res := make(map[int]int, 1000)
		for i := 1; i <= 1000; i++ {
			res[i+2000] = i
		}
		caller := caller{txs: make(map[*PEVMTxRequest]*mockTx)}
		err, _ := NewTxLevels(allReqs, nil).Run(caller.execute, caller.confirm, nil, false, false)
		ok := checkMainDB(res)
		if err != nil {
			t.Fatalf("failed, err:%v", err)
		}
		if !ok {
			t.Fatalf("invalid mainDB state")
		}
		if caller.conflictNum <= 0 {
			t.Fatalf("conflict not found, conflict:%d", caller.conflictNum)
		}
	}
	// case 6: txs with dependencies, but no txdag
	case6 := func() {
		// mainDB: [1: 15, 2: 20, 3: 0]
		// txs: [1->2:10, 2->3:10]
		// txdag: nil
		// result:
		//	 mainDB: [1: 5, 2: 20, 3: 10]
		putMainDB(map[int]int{1: 15, 2: 20, 3: 0})
		allReqs := []*PEVMTxRequest{
			newTxReq(1, 2, 10),
			newTxReq(2, 3, 10),
		}
		setTxIndex(allReqs)
		caller := caller{txs: make(map[*PEVMTxRequest]*mockTx)}
		err, _ := NewTxLevels(allReqs, nil).Run(caller.execute, caller.confirm, nil, false, false)
		ok := checkMainDB(map[int]int{1: 5, 2: 20, 3: 10})
		if err != nil {
			t.Fatalf("failed, err:%v", err)
		}
		if !ok {
			t.Fatalf("invalid mainDB state")
		}
	}

	// case 7: txs with dependencies, with default txdag (deposit tx + all comment txs)
	case7 := func() {
		//dag := &types.PlainTxDAG{}
		//dag.SetTxDep(0, types.TxDep{TxIndexes: nil, Flags: &types.ExcludedTxFlag})
		dag := int2txdag([][]int{
			{-1}, nil,
		})
		// mainDB: [1: 15, 2: 20, 3: 0]
		// txs: [1->2:10, 2->3:10]
		// txdag: [-1, nil]
		// result:
		//	 mainDB: [1: 5, 2: 20, 3: 10]
		putMainDB(map[int]int{1: 15, 2: 20, 3: 0})
		allReqs := []*PEVMTxRequest{
			newTxReq(1, 2, 10),
			newTxReq(2, 3, 10),
		}
		caller := caller{txs: make(map[*PEVMTxRequest]*mockTx)}
		setTxIndex(allReqs)
		err, _ := NewTxLevels(allReqs, dag).Run(caller.execute, caller.confirm, nil, false, false)
		ok := checkMainDB(map[int]int{1: 5, 2: 20, 3: 10})
		if err != nil {
			t.Fatalf("failed, err:%v", err)
		}
		if !ok {
			t.Fatalf("invalid mainDB state")
		}
		if caller.conflictNum != 0 {
			t.Fatalf("conflict found, conflict:%d", caller.conflictNum)
		}

	}

	case1()
	case2()
	case3()
	case4()
	case5()
	case6()
	case7()
}

func TestPredictTxDAG(t *testing.T) {
	var buildTxReq = func(from, to common.Address, txIndex int) *PEVMTxRequest {
		return &PEVMTxRequest{
			txIndex: txIndex,
			msg: &Message{
				From: from,
				To:   &to,
			},
		}
	}

	var buildLevels = func(addresses [][2]common.Address) TxLevel {
		tl := make(TxLevel, 0, len(addresses))
		for i, addr := range addresses {
			tl = append(tl, buildTxReq(addr[0], addr[1], i))
		}
		return tl
	}

	// case 1. empty txs
	var addr1, addr2, addr3, addr4 = common.Address{1}, common.Address{2}, common.Address{3}, common.Address{4}
	var dag = &types.PlainTxDAG{}
	txs := buildLevels([][2]common.Address{})
	txs.predictTxDAG(dag)
	newLevel := NewTxLevels(txs, dag)
	if len(newLevel) != 0 {
		t.Fatalf("failed, expected empty")
	}

	// case 2. 1 tx with no dependencies
	txs = buildLevels([][2]common.Address{{addr1, addr2}})
	dag = &types.PlainTxDAG{}
	txs.predictTxDAG(dag)
	newLevel = NewTxLevels(txs, dag)
	if len(newLevel) != 1 {
		t.Fatalf("failed, expected 1, got:%d", len(newLevel))
	}
	if newLevel[0][0].msg.From != addr1 {
		t.Fatalf("failed, expected addr1, got:%v", newLevel[0][0].msg.From)
	}
	// case 3. 3 txs with 2 dependencies, a->b, b->c
	txs = buildLevels([][2]common.Address{{addr1, addr2}, {addr2, addr3}, {addr3, addr4}})
	dag = &types.PlainTxDAG{}
	txs.predictTxDAG(dag)
	newLevel = NewTxLevels(txs, dag)
	if len(newLevel) != 3 {
		t.Fatalf("failed, expected 3, got:%d", len(newLevel))
	}
	if newLevel[0][0].msg.From != addr1 || newLevel[1][0].msg.From != addr2 || newLevel[2][0].msg.From != addr3 {
		t.Fatalf("failed, expected addr1, addr2, addr3, got:%v, %v, %v", newLevel[0][0].msg.From, newLevel[1][0].msg.From, newLevel[2][0].msg.From)
	}
	// case 4. 4 txs with 3 dependencies, a->b, b->c, d->b
	txs = buildLevels([][2]common.Address{{addr1, addr2}, {addr2, addr3}, {addr4, addr2}, {addr3, addr1}})
	dag = &types.PlainTxDAG{}
	txs.predictTxDAG(dag)
	newLevel = NewTxLevels(txs, dag)
	if len(newLevel) != 3 {
		t.Fatalf("failed, expected 3, got:%d", len(newLevel))
	}
	if len(newLevel[0]) != 1 || len(newLevel[1]) != 1 || len(newLevel[2]) != 2 {
		t.Fatalf("failed, expected 1, 1, 2, got:%d, %d, %d", len(newLevel[0]), len(newLevel[1]), len(newLevel[2]))
	}
	if newLevel[0][0].msg.From != addr1 || newLevel[1][0].msg.From != addr2 {
		t.Fatalf("failed, expected addr1, addr2, got:%v, %v", newLevel[0][0].msg.From, newLevel[1][0].msg.From)
	}
}

func TestNewTxLevels(t *testing.T) {
	// definition of dependencies:
	//    {-1} means dependent all txs
	//    {-2} means excluded tx
	//    nil means no dependencies
	//    {0,1} means dependent on tx[0] and tx[1]

	// case 1: empty txs
	assertEqual(levels([]uint64{}, [][]int{}), [][]uint64{}, t)

	// case 2: txs with no dependencies
	// tx[0] has no dependencies, tx[0].Nonce() == 1
	// tx[1] has no dependencies, tx[1].Nonce() == 2
	// tx[2] has no dependencies, tx[2].Nonce() == 3
	// tx[3] has no dependencies, tx[3].Nonce() == 4
	assertEqual(levels([]uint64{1, 2, 3, 4}, [][]int{nil, nil, nil, nil}), [][]uint64{{1, 2, 3, 4}}, t)

	// case 3: txs with dependencies
	// tx[0] has no dependencies, tx[0].Nonce() == 1
	// tx[1] depends on tx[0], tx[1].Nonce() == 2
	// tx[2] depends on tx[1], tx[2].Nonce() == 3
	assertEqual(levels([]uint64{1, 2, 3}, [][]int{nil, {0}, {1}}), [][]uint64{{1}, {2}, {3}}, t)

	// case 4: txs with dependencies and no dependencies
	// tx[0] has no dependencies, tx[0].Nonce() == 1
	// tx[1] has no dependencies, tx[1].Nonce() == 2
	// tx[2] dependents on t[0], tx[2].Nonce() == 3
	// tx[3] dependents on t[0], tx[3].Nonce() == 4
	// tx[4] dependents on t[2], tx[4].Nonce() == 5
	// tx[5] dependents on t[3], tx[5].Nonce() == 6
	assertEqual(levels([]uint64{1, 2, 3, 4, 5, 6}, [][]int{nil, nil, {0}, {1}, {2}, {3}}), [][]uint64{{1, 2}, {3, 4}, {5, 6}}, t)

	// case 5: 1 excluded tx + n no dependencies tx
	assertEqual(levels([]uint64{1, 2, 3}, [][]int{{-1}, nil, nil}), [][]uint64{{1}, {2, 3}}, t)

	// case 6: 1 excluded tx + n no dependencies txs + n all-dependencies txs
	assertEqual(levels([]uint64{1, 2, 3, 4, 5, 6}, [][]int{{-1}, nil, nil, nil, {-2}, {-2}}), [][]uint64{{1}, {2, 3, 4}, {5}, {6}}, t)

	// case 7: 1 excluded tx + n no dependencies txs + n dependencies txs + 1 all-dependencies tx
	assertEqual(levels([]uint64{1, 2, 3, 4, 5, 6, 7}, [][]int{{-1}, nil, nil, nil, {0, 1}, {2}, {-2}}), [][]uint64{{1}, {2, 3, 4}, {5, 6}, {7}}, t)

	// case 8:  n no dependencies txs + n all-dependencies txs
	assertEqual(levels([]uint64{1, 2, 3, 4, 5}, [][]int{nil, nil, nil, {-2}, {-2}}), [][]uint64{{1, 2, 3}, {4}, {5}}, t)

	// case 9: loop-back txdag
	assertEqual(levels([]uint64{1, 2, 3, 4}, [][]int{{1}, nil, {0}, nil}), [][]uint64{{1, 2}, {3, 4}}, t)

	// case 10: nonedependent txs + execlude txs + nonedependent txs
	assertEqual(levels([]uint64{1, 2, 3, 4, 5}, [][]int{nil, nil, {-2}, nil, nil}), [][]uint64{{1, 2}, {3}, {4, 5}}, t)
}

func TestBuildLevels(t *testing.T) {
	var (
		marks map[int]int
		depth int
	)
	// case 1: 1 excluded tx + n no dependencies txs + n dependencies txs + 1 all-dependencies tx
	marks, depth = levelMarks([]uint64{1, 2, 3, 4, 5, 6, 7}, [][]int{{-1}, nil, nil, nil, {0, 1}, {2}, {-2}})
	assertEqualMarks(marks, map[int]int{0: 0, 1: 1, 2: 1, 3: 1, 4: 2, 5: 2, 6: 3}, t)
	if depth != 4 {
		t.Fatalf("expected depth: 4, got depth: %d", depth)
	}
	// case 2: nonedependent txs + execlude txs + nonedependent txs
	marks, depth = levelMarks([]uint64{1, 2, 3, 4, 5}, [][]int{nil, nil, {-2}, nil, nil})
	assertEqualMarks(marks, map[int]int{0: 0, 1: 0, 2: 1, 3: 2, 4: 2}, t)
	if depth != 3 {
		t.Fatalf("expected depth: 3, got depth: %d", depth)
	}
	// case 3: (broken TxDAG) n dependent txs + 1 execlude tx + none dependent txs
	marks, depth = levelMarks([]uint64{1, 2, 3, 4, 5}, [][]int{{1}, {2}, {-1}, nil, nil})
	assertEqualMarks(marks, map[int]int{0: 0, 1: 0, 2: 1, 3: 2, 4: 2}, t)
	if depth != 3 {
		t.Fatalf("expected depth: 3, got depth: %d", depth)
	}
}

